def countTriplets(arr, r):
    d={}
    std=0
    for i,v in enumerate(arr):
        if v>std:
            std=v
        if d.get(v) == None:
            d[v]=[i]
        else:
            d[v].append(i)
    length=0
    for k in d.keys():
        length+=len(d[k])
    print("verify length=%d"%(length))
    count=0
    for key in d.keys():
        #print(k,"length=",len(d[k]))
        key1=key*r
        key2=key*r*r
        if key2>std:break
        if r==1:
            if len(d.get(key))>=3:
                n=len(d.get(key))
                count+=n*(n-1)*(n-2)//6
            else:
                continue
        else:
            if d.get(key1)!=None and d.get(key2)!=None:
                for j in d[key1]:
                    cnt=0
                    for i in d[key]:
                        if i<j:
                            cnt+=1
                        else:
                            break
                    cnt1=len(d[key2])
                    for k in d[key2]:
                        if k<j:
                            cnt1-=1
                        else:
                            break
                    if cnt1==0:
                        #print("j=%d, k=%d\n"%(j,d[key2][-1]))
                        break
                    #print(key1,cnt,cnt1)
                    count+=cnt*cnt1
    print("count=%d" %(count))
    return count


